import React from 'react';

const CheckboxWithSubcategory = ({ label, isChecked, onCheckboxChange, subcategory, isSubcategoryChecked, onSubcategoryChange }) => {
    return (
        <div style={{ width: '100%', height: '100%', position: 'relative' }}>
            <div style={{ width: 600, height: 610, left: 0, top: 0, position: 'absolute', background: '#EBEBEB', borderRadius: 10 }} />

            {/* Main Category */}
            <div style={{ width: 46, height: 46, left: 40, top: 37, position: 'absolute' }}>
                <div style={{ width: 46, height: 46, left: 0, top: 0, position: 'absolute', borderRadius: 6, border: '1px black solid' }} />
            </div>
            <div style={{ width: 450, height: 529, left: 110, top: 58, position: 'absolute', color: 'black', fontSize: 22, fontFamily: 'SF Pro Display', fontWeight: '400', wordWrap: 'break-word' }}>{label}</div>
            <div style={{ width: 450, height: 513, left: 110, top: 37, position: 'absolute', color: '#828282', fontSize: 12, fontFamily: 'SF Pro Display', fontWeight: '400', letterSpacing: 1.20, wordWrap: 'break-word' }}>{subcategory}</div>

            {/* Main Category Checkbox */}
            <input
                type="checkbox"
                checked={isChecked}
                onChange={onCheckboxChange}
                style={{ position: 'absolute', top: 20, left: 10 }}
            />

            {/* Subcategory Checkbox */}
            {isSubcategoryChecked !== undefined && onSubcategoryChange && (
                <input
                    type="checkbox"
                    checked={isSubcategoryChecked}
                    onChange={onSubcategoryChange}
                    style={{ position: 'absolute', top: 20, left: 70 }}
                />
            )}

            {/* Subcategory */}
            <div style={{ width: '100%', height: '100%', background: '#A8A8A8' }} />
        </div>
    );
};

export default Task;
